package org.kuali.common.devops.aws;

import org.kuali.common.util.enc.KeyPair;

public enum KeyPairs {

	FOUNDATION(
			"kuali-key",
			"ssh-rsa  kuali-key",
			"ENC()"), //
	RICE(
			"kr-key",
			"ssh-rsa  kr-key",
			"ENC()"), //

	STUDENT(
			"ks-key",
			"ssh-rsa  ks-key",
			"ENC()"), //
	OLE(
			"ole",
			"ssh-rsa  ole",
			"ENC()"), //

	DEVOPS(
			"kuali-devops",
			"ssh-rsa  kuali-devops",
			"ENC()");

	private final KeyPair keyPair;
	private final String encryptedPrivateKey;

	private KeyPairs(String name, String publicKey, String encryptedPrivateKey) {
		this.keyPair = new KeyPair.Builder(name).publicKey(publicKey).build();
		this.encryptedPrivateKey = encryptedPrivateKey;
	}

	public KeyPair getKeyPair() {
		return keyPair;
	}

	public String getEncryptedPrivateKey() {
		return encryptedPrivateKey;
	}

}
